import React, { Component } from 'react';

class Login extends Component {
    constructor(){
        super();
        this.state = {
            isLoggedIn : false,
        }
    }
    render() {
        //codition no1
        if(this.state.isLoggedIn){
            return (
                <div>
                    <h1>Welcome</h1>
                </div>
            );
        }else{
            return (
                <div>
                    <button type="">Login</button>
                </div>
            );
        }


        
    }
}

export default Login;
